('The meeksi Teatuft Tamers love lounging with their Teatufts and sipping a cup of mystical tea after a long lazy day.', '|cFFFFD200Trading Post|r', 4728, 235152, 1213903, 6310499, 0, 16466, 11, 6, 7, 0, 58238),
