INSERT INTO `broadcast_text` (`Text`, `Text1`, `ID`, `LanguageID`, `ConditionID`, `EmotesID`, `Flags`, `ChatBubbleDurationMs`, `VoiceOverPriorityID`, `SoundKitID1`, `SoundKitID2`, `EmoteID1`, `EmoteID2`, `EmoteID3`, `EmoteDelay1`, `EmoteDelay2`, `EmoteDelay3`, `VerifiedBuild`) VALUES
('<Marmaduke looks at you longingly.>', '', 278296, 0, 0, 0, 256, 0, 4, 0, 0, 0, 0, 0, 0, 0, 0, 58238),
('<Marmaduke looks at you expectantly.>', '', 278176, 0, 0, 0, 256, 0, 4, 0, 0, 0, 0, 0, 0, 0, 0, 58238),
('', 'The stars of this time are bent on new paths, beacons of hope and strength for the coming ages.', 11145, 0, 0, 0, 65, 0, 4, 0, 0, 0, 0, 0, 0, 0, 0, 58238),
('Feels good to be back on de open air!\n\nNever felt right after we all went on strike with Cableclamp. Her contractors weren\'t payin\' any of us--her included! So she brought the Princess down. Eventually we went our own separate ways for a while.\n\nBut we be back and ready to fly! Ha ha!\n\nExcept Du\'una. She\'s afraid of de bwon\'tulak, which I don\'t blame her. \n\nWe\'re sailin\' right into stormy weathers, but Shango always watchin\' over us in de storms!', '', 279769, 0, 0, 0, 256, 0, 4, 0, 0, 1, 4, 0, 0, 0, 0, 58238),
('', 'You headin\' to the Siren Isle?\n\n<Du\'una grimaces around her tusks and spits.>\n\nI told Cableclamp dis is a bad omen. I\'ve heard stories about de sirens. In zandali, we call dem \"bwon\'tulak.\" Death Singers. Terrible creatures.\n\nI am blessed. I never encountered dem before in all my time flyin\' over de seas. But now we\'re headin\' for a place named after dem?\n\n<Du\'una bows and shakes her head.>\n\nMay Shango guide de winds.', 279768, 0, 0, 0, 256, 0, 4, 0, 0, 1005, 274, 0, 0, 0, 0, 58238),
('Almost nothin\', unfortunately. I put my best guys on it to see what they could dig up.\n\nThey didn\'t find much; just a few tales from Boralus. The oldest record we could find was some Kul Tiran fable or somethin\' warning us of the dangers of \'The Call\', whatever that means. \n\nCouldn\'t find any charts or nothin\'. Seems like a place most have steered clear from, but it sounds like an opportunity if ya ask me!\n\nThankfully Ricket and my ground crew gave us enough data to work with so we could find our way back.', '', 279747, 0, 0, 0, 256, 0, 4, 0, 0, 6, 0, 0, 0, 1000, 0, 58238),
('Wouldn\'t you and half of Khaz Algar want to know! \n\nFirst the Arathi and earthen are all askin\' about it, then next thing you know, they\'re heading off in their airships and mole machines! \n\nOh, if I still had my rocket drill contacts, I betcha I coulda gotten us there faster!\n\nBut fine, ya wanna know? \n\nWe\'re headin\' to the Siren Isle. Ever heard of it?', '', 278425, 0, 0, 0, 256, 0, 4, 0, 0, 6, 0, 0, 0, 1000, 0, 58238),
('Hey, welcome aboard! The earthen and the Arathi are on the island already. We gotta catch up!', '', 273289, 0, 0, 0, 0, 0, 4, 268238, 0, 0, 0, 0, 0, 0, 0, 58238),
('See? We\'re late to the party. Meet me below. And watch your step! Heh heh heh.', '', 273102, 0, 0, 0, 0, 0, 4, 268720, 0, 0, 0, 0, 0, 0, 0, 58238);
